import React, { useState } from 'react';
import VerticalMenu from './VerticalMenu';
import './Analysis.css';
import Chart from './Chart';


function Analysis() {
  
  return (
    <div id="Analysis">
      <h1 className="chart-header">Sentimental Analysis Chart</h1>
      <div className='background'>
      <Chart/>
      <Analysis/>
      <VerticalMenu />
      </div>
    
      
      
    </div>
  );
}

export default Analysis;
